      border-radius: 10px 10px 10px 10px;
    }
    .container_12 .grid_12.stable_block
    {
      background-image: var(--bg-pedigree);
      border: 0px;
      border-radius: 10px 10px 10px 10px;
      margin: 10px;
      width: 940px;
    }
    .pedigree
    {
      background-image:var(--bg-pedigree);
      border-radius: 0px 0px 10px 10px;
      float: left;
    }
    .parentstitle, .grandparentstitle, .ggrandparentstitle
    {
      float: left;
      font-family: var(--font);
