      color: var(--text);
      font-family: var(--font);
      font-size: 13px;
      font-weight: 400;
      line-height: 18px;
    }
    .horse_blocktext p a:active, .horse_blocktext p a:link, .horse_blocktext p a:visited
    {
      color: var(--text2);
    }
    .parents p, .parents a:active p, .parents a:link p, .parents a:visited p, .grandparents p, .ggrandparents p
