      background: var(--none);
      display: flex;
      border-radius: 10px 10px 10px 10px;
      margin-bottom: 10px;
      margin-left: 8px;
      margin-right: 8px;
      padding-bottom: 10px;
      padding-left: 10px;
      padding-right: 10px;
      padding-top: 20px;
      text-align: center;
      width: 118px;
    }
    .traincon.selected
    {
      background: var(--tabelle2);
    }
    h3
    {
      color: var(--text);
      font-family: var(--font);
      font-size: 16px;
      font-weight: 700;
      line-height: 18px;
    }
    .trainbar
    {
      background: var(--progress);
      border: 2px solid var(--border);
