    {
      background: var(--none);
    }
    .training_right > .block > .comp img, .training_right > .block > .show img
    {
      background: var(--none);
    }
    button, input[type="submit"]
    {
      background: var(--button);
      border-radius: 2px 2px 2px 2px;
