      font-size: 13px;
      font-weight: 600;
      line-height: 18px;
      padding-bottom: 3px;
      padding-left: 8px;
      padding-right: 8px;
      padding-top: 3px;
    }
    button.yellow, inpute[type="submit"].yellow
    {
      background: var(--button);
    }
    button.yellow, inpute[type="submit"].yellow:hover
    {
      background: var(--button2);
    }
    .energy_val
    {
      color: var(--text)
    }
    .energy, .disc, .affection
    {
      background-image: -webkit-gradient(linear,0% 0%, 0% 100%, from(var(--progress2)), to(var(--progress2)));
