      margin-bottom: 3px;
      margin-left: 0px;
      margin-right: 0px;
      margin-top: 3px;
      width: 126px;
    }
    .training_right > .block > .barcon > .trainbar > .trained
    {
      background-image: -webkit-gradient(linear, 0% 0%, 0% 100%, from(var(--progress2)), to(var(--progress2)));
