      width: 20px; 
    }
    .genetic_potential
    {
      background-color: var(--tabelle2);
      float: left;
      padding: 10px;
    }
    .quote
    {
      background-image: var(--bg-genetic);
      background-position: right bottom;
      background-size:contain;
